                "title": "2. Importer et exporter des notes",
                "body": "# Importer et exporter des notes\n\n## Importation depuis Evernote\n\nXilinota peut importer des carnets complets depuis Evernote, ainsi que des notes, des Ã©tiquettes, des images, des fichiers joints et des mÃ©tadonnÃ©es de note (telles que l'auteur, la gÃ©olocalisation, etc.) via des fichiers ENEX.\n\nPour importer des donnÃ©es Evernote, exportez d'abord vos carnets Evernote vers des fichiers ENEX comme dÃ©crit [ici](https://help.evernote.com/hc/en-us/articles/209005557-How-to-back-up-export-and-restaurer-importer-notes-et-carnets). Ensuite, sur **bureau**, procÃ©dez comme suit : Ouvrez Fichier > Importer > ENEX et sÃ©lectionnez votre fichier. Les notes seront importÃ©es dans un nouveau cahier sÃ©parÃ©. Si nÃ©cessaire, ils peuvent ensuite Ãªtre dÃ©placÃ©s vers un autre carnet, ou le carnet peut Ãªtre renommÃ©, etc. [En savoir plus sur l'importation Evernote](https://xilinotaapp.org/help/#importing-from-evernote).\n\n# Importation Ã  partir d'autres applications\n\nXilinota peut Ã©galement importer des notes depuis de nombreuses autres applications ainsi que depuis Markdown ou depuis des fichiers texte.\n\n# Exporter des notes\n\nXilinota peut exporter au format JEX (fichier d'exportation Xilinota), qui est une archive pouvant contenir plusieurs notes, cahiers, etc. Il s'agit d'un format principalement conÃ§u Ã  des fins de sauvegarde. Vous pouvez Ã©galement exporter vers d'autres formats tels que des fichiers Markdown simples, vers JSON ou vers PDF.",
