                "id": "a57d47950ba244f38ecc9c4f1a5a7d8d",
                "title": "3. Fichiers de notes et de dÃ©marques",
                "body": "# Fichiers de notes et de dÃ©marques\n\nLa croyance centrale de cette fonctionnalitÃ© est que les notes sont vos propriÃ©tÃ©s prÃ©cieuses, probablement une extension de votre esprit. Xilinota conserve les notes et les cahiers dans une structure de fichiers simple, avec des notes stockÃ©es dans des fichiers markdown ayant chacun le titre comme nom de fichier. Les fichiers et dossiers sont maintenus Ã  jour avec la base de donnÃ©es interne. Cela vous donne un meilleur accÃ¨s et une meilleure utilisation de vos notes en dehors de Xilinota. Vous pouvez crÃ©er, ajouter, modifier ou supprimer des fichiers avec vos outils prÃ©fÃ©rÃ©s sur votre systÃ¨me, et le contenu de ces fichiers sera synchronisÃ© dans Xilinota lorsque vous le dÃ©marrerez. Et, de toute faÃ§on, lorsque vous changez d'avis sur le choix des applications, les notes sont sous forme de texte et vous pouvez facilement adopter de nouvelles faÃ§ons de gÃ©rer.\n\n#### Application de bureau\n\nSur l'application de bureau, le rÃ©pertoire personnel par dÃ©faut dans lequel les cahiers et les notes sont enregistrÃ©s se trouve sous Â« Xilinotas Â» sous Â« Documents Â» du rÃ©pertoire personnel de l'utilisateur, dans la notion Linux : Â« /home/loginname/Documents/Xilinotas/ Â» (il peut ne pas Ãªtre personnalisÃ© maintenant). En dessous, vous trouverez des sous-rÃ©pertoires basÃ©s sur votre identifiant de profil. Si vous n'avez pas ajoutÃ© de profils supplÃ©mentaires, tous les cahiers et notes sont enregistrÃ©s dans le sous-rÃ©pertoire Â« par dÃ©faut Â». Les blocs-notes sont organisÃ©s sous forme d'arborescences de rÃ©pertoires et les fichiers de notes se trouvent dans les dossiers de bloc-notes associÃ©s. (Remarque, si vous exÃ©cutez une version de dÃ©veloppement Ã  partir des sources, le rÃ©pertoire sera \"/home/loginname/Documents/XilinotasDev/\").\n\n#### Application Android\n\nLe rÃ©pertoire personnel par dÃ©faut sur Android est diffÃ©rent. Sur Android 9 ou version antÃ©rieure, le rÃ©pertoire est \"/Android/data/ac.mdiq.xilinota/files/Xilinotas\". Sur Android 10 ou version ultÃ©rieure, le rÃ©pertoire est choisi par vous lors du premier dÃ©marrage de Xilinota. Ces rÃ©pertoires ne peuvent pas Ãªtre modifiÃ©s pour le moment. (Avec la version dev, sur Android 9 ou version antÃ©rieure, le rÃ©pertoire est \"/Android/data/ac.mdiq.xilinota/files/XilinotasDev\".\n\n#### MÃ©canismes\n\nAu dÃ©marrage de Xilinota, lorsque les rÃ©pertoires personnels n'existent pas, Xilinota les crÃ©era et les remplira de sous-rÃ©pertoires et de fichiers. Si vous avez beaucoup de notes, il y aura une courte attente (avec le bureau Xilinota) une fenÃªtre contextuelle avec une barre animÃ©e indique que la tÃ¢che est en cours. Les sous-rÃ©pertoires sont nommÃ©s avec les titres des cahiers. Les fichiers sont nommÃ©s avec les titres des notes, comme : \"le titre de la note.md\". Dans le cas d'une note de tÃ¢che, elle est nommÃ©e \"X - note title.md\" (si la tÃ¢che n'est pas terminÃ©e) ou \"V - note title.md\" (si la tÃ¢che a Ã©tÃ© terminÃ©e). complÃ©tÃ©).\n\nTout caractÃ¨re spÃ©cial parmi `?:\\\"*|/\\\\<>` dans le titre est supprimÃ©.\n\nVous pouvez crÃ©er, mettre Ã  jour, dÃ©placer, supprimer des notes ou des cahiers dans Xilinota et les fichiers et rÃ©pertoires sont rapidement mis Ã  jour.\n\n#### Ressources\n\nLes ressources (images ou piÃ¨ces jointes dans les notes) se trouvent dÃ©sormais dans le sous-rÃ©pertoire \".resources\" du rÃ©pertoire de chaque notebook (le sous-rÃ©pertoire \"_resources\" est rÃ©servÃ© pour une utilisation future). Le fichier Markdown affichÃ© dans la visionneuse externe affiche dÃ©sormais les ressources associÃ©es. Les fichiers de ressources sont copiÃ©s lorsque le rÃ©pertoire \"Xilinotas\" est rempli pour la premiÃ¨re fois et sont enregistrÃ©s lors de la modification de la note lorsque des ressources sont ajoutÃ©es Ã  la note. Les ressources suivent dÃ©sormais la note associÃ©e, c'est-Ã -dire que lorsque vous dÃ©placez/supprimez une note, les fichiers de ressources associÃ©s seront traitÃ©s de la mÃªme maniÃ¨re.\n\nLes fichiers de ressources sont actuellement copiÃ©s depuis le rÃ©pertoire de configuration de Xilinota, vous avez donc des fichiers en double sur votre systÃ¨me. Ã€ l'avenir, il semble plus raisonnable d'avoir les ressources proches des fichiers de notes, j'Ã©tudie donc les possibilitÃ©s de supprimer le rÃ©pertoire de ressources sous le rÃ©pertoire de configuration de Xilinota. Mais ce sera Ã  un stade ultÃ©rieur.\n\nLes fichiers et dossiers du systÃ¨me de fichiers sont synchronisÃ©s avec Xilinota. Le processus se dÃ©roule au dÃ©but de Xilinota. Avec le bureau Xilinota, similaire au premier processus de remplissage de fichiers, une fenÃªtre contextuelle apparaÃ®t avec une barre animÃ©e pendant le processus de synchronisation. Dans les applications mobiles, ce processus de synchronisation s'exÃ©cute en arriÃ¨re-plan sans bloquer aucune autre fonction de Xilinota.\n\nTous les fichiers ou dossiers de notes ajoutÃ©s ou supprimÃ©s seront synchronisÃ©s dans Xilinota. Un fichier de dÃ©marque s'il est modifiÃ© aprÃ¨s la sortie prÃ©cÃ©dente de Xilinota est Ã©galement synchronisÃ©. L'ajout d'un dossier externe avec des fichiers markdown synchronisera tous les fichiers. La suppression d'un dossier entraÃ®ne Ã©galement la suppression de toutes les notes du dossier de Xilinota aprÃ¨s la synchronisation (bien que le bloc-notes correspondant au dossier reste).\n\nUne note positive : si vous supprimez le rÃ©pertoire personnel, ou le rÃ©pertoire de profil (par exemple par dÃ©faut) sous le rÃ©pertoire personnel, ou tous les dossiers et fichiers sous le rÃ©pertoire de profil, Xilinota ne supprimera pas toutes vos notes et cahiers dans la base de donnÃ©es, mais plutÃ´t il remplira Ã  nouveau tout le rÃ©pertoire personnel.\n\n#### Avis spÃ©cial et limitations\n\nActuellement, le dÃ©placement de dossiers dans le systÃ¨me de fichiers n'est pas synchronisÃ© avec Xilinota. De plus, le dÃ©placement d'une note vers un autre dossier n'est pas pris en charge pour la synchronisation et cela n'est pas encouragÃ© car le dÃ©placement manuel d'un fichier de note peut entraÃ®ner des ressources liÃ©es sans correspondance. Ces opÃ©rations sont donc mieux menÃ©es au sein de Xilinota.",
