                "title": "4. Synchroniser vos notes",
                "body": "# Synchroniser vos notes\n\nXilinota prend en charge tous les moyens de synchronisation, notamment Dropbox, Nextcloud, OneDrive ou WebDAV et Joplin Cloud. Pour obtenir des instructions, reportez-vous aux documents Joplin associÃ©s.\n\nDe plus, Xilinota propose une nouvelle faÃ§on de synchroniser vos notes : la synchronisation instantanÃ©e.\n\n## Synchronisation instantanÃ©e sur tous les appareils\n\nLa synchronisation des notes via le cloud, des serveurs externes ou avec l'aide d'une application tierce comme Syncthing peut toujours Ãªtre utilisÃ©e si vous le souhaitez. Xilinota vous propose une nouvelle faÃ§on de synchroniser vos notes : une maniÃ¨re instantanÃ©e, qui est sÃ»rement plus pratique. Certes, Xilinota fonctionne sur plusieurs plates-formes que vous choisissez, cependant, toutes celles-ci sont destinÃ©es Ã  une seule personne : vous, l'utilisateur. Ainsi, la possibilitÃ© dâ€™effectuer une synchronisation instantanÃ©e supprime le processus de manipulations compliquÃ©es. Voici comment cela fonctionne.\n\nActuellement, cela suppose que vous utilisez votre ordinateur pour effectuer le gros travail de prise de notes et que vos tÃ©lÃ©phones sont des assistants ou effectuent des tÃ¢ches occasionnelles. Vous pouvez choisir de conserver seulement une partie ou la totalitÃ© des cahiers de votre ordinateur sur n'importe quel tÃ©lÃ©phone (j'aime que les tÃ©lÃ©phones soient plus lÃ©gers et ne conservent pas toutes les notes professionnelles complexes sur lesquelles je travaille sur mon ordinateur, mais vous pouvez faire votre propre choix).\n\nPour commencer, assurez-vous de dÃ©finir un mÃªme mot de passe privÃ© dans Xilinota sur tous vos appareils. Cela peut Ãªtre fait dans Options (ou Configuration) -> Application.\n\nSupposons maintenant que vous ayez Notebook1 et Notebook2 sur votre ordinateur et que vous souhaitiez Ã©galement les conserver sur votre PhoneA. Lorsque l'ordinateur et PhoneA sont sur le mÃªme rÃ©seau local (ils se connectent automatiquement), vous sÃ©lectionnez Notebook1 et Notebook2, faites un clic droit pour obtenir le menu contextuel et choisissez \"Envoyer aux pairs\". Ensuite, les deux cahiers ainsi que leurs sous-structures et notes sont envoyÃ©s Ã  PhoneA. Vous pouvez Ã©galement faire une chose similaire depuis un tÃ©lÃ©phone vers un ordinateur ou dâ€™autres appareils. Pour le moment, le taux de transfert est limitÃ© Ã  environ 2 notes par seconde, juste pour que le rÃ©cepteur puisse maintenir la charge de travail.\n\nDÃ©sormais, votre ordinateur et PhoneA disposent de Notebook1 et Notebook2. Lorsque vous modifiez et enregistrez une note dans les blocs-notes partagÃ©s sur n'importe quel appareil, la note est instantanÃ©ment synchronisÃ©e avec les autres.\n\nVotre ordinateur peut avoir Notebook3 et PhoneA peut avoir PhoneNotes, les modifications dans les blocs-notes non partagÃ©s ne sont pas synchronisÃ©es. Mais vous pouvez envoyer instantanÃ©ment des notes de ces blocs-notes non partagÃ©s vers d'autres appareils en sÃ©lectionnant n'importe quelle note et en choisissant Â« Envoyer Ã  des pairs Â» dans le menu contextuel. Les notes reÃ§ues seront placÃ©es dans un bloc-notes crÃ©Ã© automatiquement nommÃ© \\_InBox.\n\nLorsque vous dÃ©placez une note ou un sous-carnet dans un bloc-notes partagÃ©, il sera dÃ©placÃ© en consÃ©quence sur d'autres appareils. Si vous dÃ©placez une note vers un bloc-notes non partagÃ©, elle sera supprimÃ©e sur d'autres appareils. Et si vous supprimez une note ou un carnet dans un carnet partagÃ©, il sera Ã©galement supprimÃ© sur dâ€™autres appareils.\n\nLes opÃ©rations hors ligne sur les notes et les blocs-notes sont synchronisÃ©es de maniÃ¨re croisÃ©e lorsqu'un appareil est connectÃ© Ã  d'autres appareils (avec un ordinateur de bureau comme hub). La synchronisation hors ligne des blocs-notes supprimÃ©s est dÃ©sormais observÃ©e et n'est pas activÃ©e dans les applications publiÃ©es.\n\nL'envoi de blocs-notes depuis le bureau peut Ãªtre ciblÃ© sur un appareil spÃ©cifique ou sur tous.\n\n#### Avis spÃ©cial, limitations et tÃ¢ches Ã  accomplir\n\nActuellement, rien nâ€™indique si un appareil est connectÃ© Ã  dâ€™autres sur le rÃ©seau. La connexion est trÃ¨s instantanÃ©e, vous pouvez donc supposer qu'ils sont connectÃ©s si vos appareils sont en ligne, que le code d'accÃ¨s privÃ© est dÃ©fini avec le mÃªme jeton sur tous les appareils et que Xilinota a Ã©tÃ© dÃ©marrÃ© sur les appareils. Un moyen d'indication sera ajoutÃ© ultÃ©rieurement.\n\nLâ€™envoi dâ€™un notebook racine peut prendre un certain temps. Actuellement, il existe une fenÃªtre contextuelle animÃ©e (sur le bureau uniquement) indiquant la tÃ¢che en cours (mais pas de rapport de progression), et lorsque la tÃ¢che est terminÃ©e, la fenÃªtre contextuelle se ferme. En gros, pour une estimation, il faut par note une demi-seconde de temps d'inactivitÃ© (Ã©tranglÃ©) plus un peu de temps pour l'envoi. L'envoi ou la synchronisation d'une seule note est instantanÃ© et aucune indication de progression n'est nÃ©cessaire.\n\nLors de la synchronisation des notes hors ligne, il n'existe actuellement aucun mÃ©canisme de gestion des conflits (les mÃªmes notes modifiÃ©es sur plusieurs appareils pendant la pÃ©riode hors ligne). Fondamentalement, les notes du dernier appareil synchronisÃ© Ã©crasent les autres, et les notes de l'ordinateur Ã©crasent celles des mobiles.\n\nLes ressources intÃ©grÃ©es (images) ne sont ni envoyÃ©es ni synchronisÃ©es. Je prÃ©vois d'effectuer un transfert Ã  la demande lorsqu'une note contenant la ressource est ouverte, et cela n'a pas encore Ã©tÃ© implÃ©mentÃ©.\n\nL'envoi de notes (et l'envoi de blocs-notes depuis un mobile) s'effectuent actuellement vers tous les appareils connectÃ©s. Donc, si vous souhaitez envoyer vers un appareil spÃ©cifique maintenant, assurez-vous que Xilinota ne fonctionne pas sur d'autres appareils.",
