                "title": "5. Autres fonctionnalitÃ©s notables",
                "body": "# Autres fonctionnalitÃ©s notables\n\n### Carnets virtuels\n\nHabituellement, nous mettons des notes dans des cahiers (ou des dossiers). C'est une maniÃ¨re courante d'organiser les Ã©lÃ©ments de note. Le problÃ¨me est bien souvent quâ€™une note nâ€™appartient guÃ¨re Ã  une seule catÃ©gorie de carnets. Par exemple, faut-il mettre une note sur Â« voiture de sport Â» dans le carnet Â« Sports Â» ou dans le carnet Â« Voitures Â» ? C'est donc avec rÃ©signation que nous l'avons mis dans un carnet \"plus connexe\", \"Cars\". Heureusement, avec de nombreux outils, nous pouvons utiliser des balises pour faciliter la catÃ©gorisation, nous marquons donc la note avec Â« Sport Â» et Â« Voiture Â», mais cela implique beaucoup de travail manuel pour une grande quantitÃ© de notes. Voici donc la fonctionnalitÃ© de bloc-notes virtuel pour vous aider.\n\nPour faire simple, le carnet virtuel peut Ã©galement Ãªtre appelÃ© balises automatisÃ©es. Pour le moment, les balises sont toujours crÃ©Ã©es par l'utilisateur, soit en attribuant des balises Ã  une note de la maniÃ¨re habituelle, soit en crÃ©ant des balises libres. Dites avec le tag \"Sport\", qui a Ã©tÃ© attribuÃ© manuellement Ã  8 notes par vos soins, laborieusement. Et comme d'habitude, lorsque vous cliquez sur le tag \"Sport\", Xilinota affiche les 8 notes liÃ©es au tag. Le carnet virtuel va encore plus loin : lorsque vous faites un clic droit (ou sur mobile, appuyez simplement longuement) sur la balise \"Sport\" et choisissez \"Virtuel\" dans le menu, Xilinota vous montre maintenant toutes les notes contenant le mot \"Sport\", 126 notes, dont la note susmentionnÃ©e sur les voitures de sport. Alors dÃ©sormais, le tag Â« Sport Â» se comporte comme un carnet contenant la plupart des notes liÃ©es au sport. C'est un peu comme faire une recherche, mais le carnet virtuel ici concerne davantage l'organisation que la recherche informelle.\n\n### Sauvegarde automatique quotidienne du fichier DB\n\nÃ€ chaque dÃ©marrage, Xilinota vÃ©rifie l'Ã©tat du fichier de sauvegarde. S'il date de plus d'un jour, une nouvelle sauvegarde est effectuÃ©e. Le fichier sauvegardÃ© est nommÃ© \"database.sqlite.bak\" et est stockÃ© Ã  cÃ´tÃ© du fichier de base de donnÃ©es \"database.sqlite\" dans le rÃ©pertoire de configuration du profil associÃ©. Sous Linux, cela devrait Ãªtre : \"/home/loginname/.config/xilinota-desktop/\" ou un sous-rÃ©pertoire de celui-ci pour un profil spÃ©cifique.\n\n#### Avis spÃ©cial et limitations\n\nCette fonctionnalitÃ© est uniquement disponible sur l'application de bureau.\n\n### AmÃ©liorations de l'efficacitÃ©\n\nUne amÃ©lioration de l'efficacitÃ© concerne la frÃ©quence de sauvegarde des notes pendant l'Ã©dition. Le mÃ©canisme consistait Ã  enregistrer la note Ã©ditÃ©e dans la base de donnÃ©es Ã  chaque frappe, ce qui semble assez inefficace. DÃ©sormais, la note est enregistrÃ©e toutes les 60 secondes ou lorsque vous quittez l'Ã©diteur de notes. Les notes inchangÃ©es ne sont pas enregistrÃ©es.\n\nL'efficacitÃ© de l'Ã©diteur est encore amÃ©liorÃ©e en minimisant les recherches de ressources pendant l'Ã©dition.\n\n#### Limitations\n\nL'Ã©diteur de texte enrichi n'est actuellement pas pris en charge.",
